As i said on Louis Video:

1) Those CSAT hashes are store on a server, and new hashes can be uploaded any time. Crazy case: Hitler becomes president of US, then he can force the gov agency managing the CSAT data base to upload hashes of all Hitler's internet memes and use the system to squash all who oppose him;

2) They say it scans only pictures on the current version, But hey! with a bit of changes it could text files, all your messages to look for certain phrases, and then again look at point 1;

3) They say right now is a simple HASH, and use a bit of neural network, but in upcoming versions, who knows how the algorith is tweaked, then if you get flase flagged, then humans can see your pictures. Better make sure you wife does not look very young, or have smooth skin, or just comed back from spa.... so the algo do not think you got pictures with naked kids in your phone;

4) And Most important: Phones are word wide sold. Right now they will implement it for US only, but in future, pretty sure they will use local goverments CSAT databases, and pretty sure CHINA will have a lot of non-CSAT hashes in their CSAT hashes to spy on their own people.
Do not think Apple will cave in for china? They already moved the icloud storage for chinese users to a goverment runned data-center.

The thing is about future of this tech, not what is said just right now. The tech always evolve, and most of times is not for the sake of the normal people.

